(16524, 'The initial window is the invoice search page. At the top you may enter a source (e.g. check number), pay date and check amount. The reason for the source and pay date is so that you don\'t have to enter them over and over again for each claim. The amount that you enter will be decreased for each invoice that is given part of the payment, and hopefully will end at zero when you are done.'),
(16525, 'The medicine type was changed today therefore medicine given is blocked today to prevent conflicts'),
(16526, 'The second (\"source\") chart will have its demographics, history and insurance sections discarded. Its other data will be merged into the target chart.'),
(16527, 'The Source and Date columns are copied from the first page, so normally you will not need to touch those. You can put a payment amount in the Pay column, an adjustment amount in the Adjust column, or both. You can also click the \"W\" on the right to automatically compute an adjustment value that writes off the remainder of the charge for that line item.'),
(16528, 'The X12 files as well as the resulting HTML output reports are archived in the \"era\" subdirectory of the main OpenEMR installation directory. You will want to refer to these archives from time to time. The URL is '),
(16529, 'There are errors with your submission. These are outlined below.'),
